import logo from './logo.svg';
import './App.css';
import FirstPage from './firstPage';
import QuizPage from './quizPage';

function App() {
  return (
    <Routes>
      <Route path="/" element={<FirstPage/>}/>
      <Route path="/quiz" element={<QuizPage/>}/>
    </Routes>
  );
}

export default App;
